--
-- Estrutura para visualizar `v_agendamento`
--
DROP TABLE IF EXISTS `v_agendamento`;

CREATE  VIEW `v_agendamento` AS select `A`.`CODIGO` AS `CODIGO`,`A`.`COD_CLIENTE` AS `COD_CLIENTE`,replace(`A`.`START`,' ','T') AS `start`,replace(`A`.`END`,' ','T') AS `end`,`A`.`COD_FUNCIONARIO_SALA` AS `COD_FUNCIONARIO_SALA`,`A`.`CONFIRMADO` AS `CONFIRMADO`,`A`.`DATA_CADASTRO` AS `DATA_CADASTRO`,concat(`U`.`NOME`,'\n',`F`.`NOME`,'\n',`S`.`NOME`) AS `title`,`S`.`COD_ASSOCIADO` AS `COD_ASSOCIADO`,`S`.`BACKGROUNDCOLOR` AS `backgroundColor`,`S`.`TEXTCOLOR` AS `textColor`,`S`.`BORDERCOLOR` AS `borderColor`,`A`.`EDITABLE` AS `editable` from (((`agendamento` `A` join `usuario` `U` on((`U`.`CODIGO` = `A`.`COD_CLIENTE`))) join `funcionario` `F` on((`F`.`CODIGO` = `A`.`COD_FUNCIONARIO_SALA`))) join `servico` `S` on((`S`.`CODIGO` = `A`.`COD_SERVICO`)));

